import {connect} from 'react-redux';
import * as actionTypes from '../../../store/actions/actionTypes';
class RealDetail extends Component{

    componentDidMount(){
        this.props.onGetTodo(parseInt(this.props.match.params.id));
    }
    render() {
        if (this.props.match) {
          console.log(this.props.match.params.id);
        }
        return (
          < div className="TodoDetail" >
            <div className="row">
              <div className="left">
                Name:
            </div>
              <div className="right">
                {this.props.title}
              </div>
            </div>

            <div className="row">
              <div className="left">
                Content:
            </div>
              <div className="right">
                {this.props.content}
              </div>
            </div>
          </div >
        );
      }
}
const mapStateToProps = state =>{
    return {
        selectedTodo:state.td.selectedTodo,
    };
};

const mapDispatchToProps = dispatch =>{
    return{
        onGetTodo: id=>
            dispatch({type: actionTypes.GET_TODO, targetID:id}),
    };
};
export default connect(mapStateToProps, mapDispatchToProps)(RealDetail);
